nt des fonctions rseaux.','fr',0,0),(214,'Une <em>page</em>, similaire  un <em>article</em> dans sa forme, est une mthode simple pour afficher des informations qui changent rarement, comme la page \"A propos\" d\'un site. Par dfaut, un contenu de type <em>page</em> ne permet pas aux visiteurs de laisser des commentaires, et celle-ci ne sera pas publie sur la page d\'accueil.','fr',0,0),(215,'Article','fr',0,0),(216,'Un <em>article</em>, similaire dans la forme  une <em>page</em>, est idal pour crer et afficher du contenu qui informe et pousse les visiteurs  ragir. Revues de presse, actualit, billet de blog peuvent tre crs avec un <em>article</em>. Par dfaut, un <em>article</em> est automatiquement publi sur la page d\'accueil de votre site et permet aux visiteurs d\'ajouter des commentaires.','fr',0,0);
